         "In some jurisdictions, the lawful handling of personal information is subject to a justification, sometimes referred to as legal basis. The legal bases that we rely on for the lawful handling of your personal information vary depending on the purpose and applicable law." : "[også populært~In some jurisdictions, the lawful handling of personal information is subject to a justification, sometimes referred to as legal basis. The legal bases that we rely on for the lawful handling of your personal information vary depending on the purpose and applicable law.]",
         "The different legal bases that we use are:" : "[også populært~The different legal bases that we use are:]",
         "Necessary for the performance of a contract with you:" : "[også populært~Necessary for the performance of a contract with you:]",
         "We rely on this legal basis when we need to process certain personal information, such as your contact details, payment details, and shipment details, to perform our obligations or to manage our contractual relationship (see above) with you." : "[også populært~We rely on this legal basis when we need to process certain personal information, such as your contact details, payment details, and shipment details, to perform our obligations or to manage our contractual relationship (see above) with you.]",
         "Examples:" : "[også populært~Examples:]",
         "    If you intend to purchase a product or service, we require your business contact information to enter into a contract with you or you may need to create an IBMid (see Your Account (above) to access a purchased product online." : "[også populært~    If you intend to purchase a product or service, we require your business contact information to enter into a contract with you or you may need to create an IBMid (see Your Account (above) to access a purchased product online.]",
         "    When fulfilling a contact, you may need to receive support services (see above) for which we will need to collect your contact information." : "[også populært~    When fulfilling a contact, you may need to receive support services (see above) for which we will need to collect your contact information.]",
         "    We need personal information to consider job applicants or manage the pension entitlements of retirees (see Recruitment and Former employees (above))." : "[også populært~    We need personal information to consider job applicants or manage the pension entitlements of retirees (see Recruitment and Former employees (above)).]",
         "Necessary for the purposes of IBM\u2019s or a third party\u2019s legitimate interest" : "[også populært~Necessary for the purposes of IBM’s or a third party’s legitimate interest]",
         "Legitimate interests relate to being able to conduct and organize business, which includes the marketing of our offerings, protecting our legal interests, securing our IT environment, or meeting client requirements." : "[også populært~Legitimate interests relate to being able to conduct and organize business, which includes the marketing of our offerings, protecting our legal interests, securing our IT environment, or meeting client requirements.]",
         "    We capture your use of, and interaction with our websites (see above) to improve them." : "[også populært~    We capture your use of, and interaction with our websites (see above) to improve them.]",
         "    We process your IBMid (see Your Account (above) ) to manage access authorization of our services." : "[også populært~    We process your IBMid (see Your Account (above) ) to manage access authorization of our services.]",
         "    Where we have a contractual relationship (see above) with the organization that you are working for, we have a legitimate interest to process your personal information used to manage this contract." : "[også populært~    Where we have a contractual relationship (see above) with the organization that you are working for, we have a legitimate interest to process your personal information used to manage this contract.]",
         "    We process your business contact information (see Your Account (above)) in combination with other business-relevant information to tailor our interactions with you and promote our products and services. We may process your contact information together with details of an IBM event you attended to develop Marketing (see above) and business intelligence." : "[også populært~    We process your business contact information (see Your Account (above)) in combination with other business-relevant information to tailor our interactions with you and promote our products and services. We may process your contact information together with details of an IBM event you attended to develop Marketing (see above) and business intelligence.]",
         "    We process the personal information of applicants based on our legitimate interest to source suitable talent (see Recruitment and Former Employees (above))." : "[også populært~    We process the personal information of applicants based on our legitimate interest to source suitable talent (see Recruitment and Former Employees (above)).]",
         "    We have to keep our general business operations (see above) functional. To this end we may, for example, processes the log in information of our IT systems and networks, or CCTV footage at IBM locations (see above) for security and safety purposes." : "[også populært~    We have to keep our general business operations (see above) functional. To this end we may, for example, processes the log in information of our IT systems and networks, or CCTV footage at IBM locations (see above) for security and safety purposes.]",
         "We may also process personal information where it is necessary to defend our rights in judicial, administrative, or arbitral proceedings. This also falls under the legal basis of legitimate interest in countries where they are not a separate legal basis." : "[også populært~We may also process personal information where it is necessary to defend our rights in judicial, administrative, or arbitral proceedings. This also falls under the legal basis of legitimate interest in countries where they are not a separate legal basis.]",
         "We process personal information for credit protection, which is a specific legal basis under Brazilian law (LGPD) but is also covered under the legal basis of legitimate interest in other countries." : "[også populært~We process personal information for credit protection, which is a specific legal basis under Brazilian law (LGPD) but is also covered under the legal basis of legitimate interest in other countries.]",
         "Consent" : "[også populært~Consent]",
         "The processing is based on your consent where we request this. Example:" : "[også populært~The processing is based on your consent where we request this. Example:]",
         "\u2022 the optional use of cookies or similar technologies (see above) or email of marketing (see above) materials." : "[også populært~• the optional use of cookies or similar technologies (see above) or email of marketing (see above) materials.]",
         "Legal obligation" : "[også populært~Legal obligation]",
         "Where we need to process certain personal information based on our legal obligation. Example:" : "[også populært~Where we need to process certain personal information based on our legal obligation. Example:]",
         "\u2022 We may be obliged to ask for a government-issued ID for certain transactions, such as for a financing transaction (see Contractual Relationship (above))." : "[også populært~• We may be obliged to ask for a government-issued ID for certain transactions, such as for a financing transaction (see Contractual Relationship (above)).]",
